import React, { useEffect } from "react";
import Card from "react-bootstrap/Card";
import four from "./line_icons/4.svg";

const LineCard = (props) => {
  const iconRef = useRef();
  useEffect(() => {
    const importIcon = async () => {
      try {
        const iconPath = await import(
          `./line_icons/${props.line.toLowerCase()}.svg`
        );
        ImportedIconRef.current = iconPath;
      } catch (err) {}
    };
  });

  // const iconPath = `${props.line.toLowerCase()}.svg`;
  return (
    <Card className="cardWrapper">
      <Card.Body>
        <Card.Title className="lineTitle">
          <img src={four} width="25" height="25" />
        </Card.Title>
        <Card.Subtitle className="mb-2 text-muted">Downtown</Card.Subtitle>
        <Card.Text>2 min</Card.Text>
        <Card.Subtitle className="mb-2 text-muted">Uptown</Card.Subtitle>
        <Card.Text>4 min</Card.Text>
      </Card.Body>
    </Card>
  );
};

export default LineCard;
